import InvoiceStats from "./InvoiceStats";
import PersonStats from "./PersonStats";

const StatsIndex = () => {
        const [personsStats, setPersonsStats] = useState([]);
        const [pesonalStats, setPersonalStats] = useState([]);

        useEffect(() => {
            apiGet("/api/persons/statistics").then((data) => setPersonsStats(data));
        }, []);

        useEffect(() => {
            apiGet("/api/invoices/statistics").then((data) => setPersonalStats(data));
        }, []);

        return(
            <div>
                <h1>Statisky společnosti</h1>
                <InvoiceStats items={pesonalStats} />

                <h1>Statistiky společností</h1>
                <PersonStats items={personsStats} />
            </div>
        )
}

export default StatsIndex;
